            <h1 class="section-theme-background-indicator publication-font" itemprop="headline name">La mujer más rica de Chile está dejando que todos usen un programa de Bitcoin para los súper ricos, y los banqueros están molestos</h1>
            <p itemprop="description">“Ya he molestado a algunas personas, pero esto es lo correcto.”</p>
            <!-- End Headlines & Sub -->
            <div class="byline">
                <div class="sharebar">
                    <a href="https://www.wealthtrk.com/949SSW4/2CTPL/?uid=3">
