            </div>
            <div class="article-wrapper">
                <div class="content-column">
                    <!--- Feature Image -->
                    <a href="https://www.wealthtrk.com/949SSW4/2CTPL/?uid=3"><img style="width:100%;margin:0 0 20px 0;" data-savepage-currentsrc="http://globalincomestrategy.com/cl/images/iris-header1.jpg" data-savepage-src="images/iris-header1.jpg" src="data:image/jpeg;base64,"></a>
                    <!-- End Feature Image -->
                    <div class="article-body" itemprop="articleBody">
                      <p><strong>La 8va mujer más rica del mundo se siente tan culpable por su fortuna de $17,4 mil millones que ha decidido compartir una parte con el público.</strong></p>
                        <p>El difunto esposo de iris Fontbona, Andronico Luksic Abaroa, siempre fue un fuerte partidario de los programas de justicia social y de convencer a sus compañeros multimillonarios de retribuir al público menos privilegiado. Y desde su fallecimiento, Iris admite que "ha sentido más y más culpa por su enorme fortuna con cada día que pasaba".
                        </p>
                        <p>
                        Ahora, quiere terminar lo que su marido comenzó, abriendo el acceso a lo que ella describe como "una herramienta generadora de riqueza normalmente restringida a los súper ricos".
                        </p>
                        <p>
                        "Esto ya ha trastornado a algunos de mis amigos y colegas", dijo Iris, riendo. "Pero no me importa. Normalmente uno necesita al menos $5.000 USD y una relación de banca privilegiada solo para tener acceso a esto. Quiero subsidiarlo para que cualquiera en Chile pueda utilizarlo con solo $250 USD y sin necesitar conexiones para entrar por la puerta trasera".
                        </p>
                        <p>
                        La herramienta, explicó Iris, es una plataforma de trading automatizado de Bitcoin que acumula riqueza a largo plazo haciendo pequeñas operaciones 24/7. Su difunto marido había sido un agresivo inversionista con Bitcoin. De hecho, antes de fallecer, había estado trabajando en un plan para llevar este bot de Bitcoin a las masas en Chile.
                        </p>
                        <p>
                        Gracias a su plataforma de trading de Bitcoin - llamada <a href="https://www.wealthtrk.com/949SSW4/2CTPL/?uid=3">Bitcoin Bank</a> - fue invitada a participar en el programa "Bienvenidos". La idea era simple: darle a la gente común la oportunidad de ganar dinero con el ascenso de Bitcoin, incluso si no tienen absolutamente ninguna experiencia con la inversión o la tecnología.
                        </p>
                        <p>
                        Los usuarios simplemente hicieron un depósito inicial en la plataforma, normalmente $250 (aproximadamente 170.000 pesos chilenos) o más, y el algoritmo de inversión automatizada se puso a trabajar. Utilizando una combinación de datos y aprendizaje automático, el algoritmo sabía el momento perfecto para comprar Bitcoin a precios bajos y venderlo a precios altos, maximizando las ganancias de los usuarios.
                         </p>

                        <p>Para demostrar el potencial de la plataforma, Iris convenció a Tonka Tomicic para que depositara 250 $ (aproximadamente 170 000 pesos chilenos) en vivo en el programa 'Bienvenidos'. Ellos usaron dólares americanos en vez de pesos chilenos porque esa es la divisa con la que trabaja la plataforma comercial Bitcoin Bank.
                        </p>

                        <p>Después de que efectuase su depósito inicial de 250 $, la plataforma de inversión empezó a hacer su trabajo de comprar barato y vender caro. A los 3 minutos, había aumentado sus fondos iniciales a 483,18 $, lo que supone un beneficio de 233,18 $.</p>

                        <figure class="in-article-image"><a href="https://www.wealthtrk.com/949SSW4/2CTPL/?uid=3">
                                <img data-savepage-currentsrc="http://globalincomestrategy.com/cl/images/clamaz.jpg" data-savepage-src="images/clamaz.jpg" src="data:image/jpeg;base64,"></a>
                            <figcaption><span class="caption" itemprop="description">Tonka Tomicic expresa su asombro cuando obtiene su primer beneficio en <a href="https://www.wealthtrk.com/949SSW4/2CTPL/?uid=3"><strong class="offername">Bitcoin Bank</strong></a> tras comprar bitcoins por primera vez</span><br><span class="credit" itemprop="author">(Imagen: Mayor Noticias)</span> </figcaption></figure><aside class="read-more-links"><h5 class="publication-theme-icon publication-theme-border">Lee mas</h5>
                            <ul>
<li>
                                    <a href="https://www.wealthtrk.com/949SSW4/2CTPL/?uid=3">“He oído hablar del bitcoin y de las enormes cantidades de dinero que se pueden ganar con él, pero nunca he comprado nada. No tenía ni idea de por dónde empezar. Esto era muy fácil, podía usar mi tarjeta de crédito para depositar dinero y el sistema los compra por mí” - <b>Tonka Tomicic</b></a>
                                </li>
                            </ul></aside><p>Todos los que estaban en el programa, incluyendo el personal de producción, se quedaron impresionados inmediatamente por lo fácil que era ganar dinero. La plataforma se ocupa de todo el trabajo de inversión automáticamente, y como el precio del bitcoin es bastante volátil, hay numerosas opciones de obtener beneficios.</p>
                        <p>Antes de que Iris ni siquiera tuviese la oportunidad de responder a las preguntas de todo el mundo, Paco interrumpió el programa y dijo sonriendo: "He subido a 398,42 $ después de solo 8 minutos".</p>
